  {
    id: 1,
    image: process.env.PUBLIC_URL + "/moneyback.jpg",
    tag: "AFAQS",
    title: "Sachin and Sara Tendulkar share bond with their dogs in new Spinny ad",
  },
  {
    id: 2,
    image: process.env.PUBLIC_URL + "/buzz2.jpg",
    tag: "AFAQS",
    title: "Spinny celebrates December with new brand partnerships",
  },
  {
    id: 3,
    image: process.env.PUBLIC_URL + "/buzz3.jpg",
    tag: "AUTO NEWS",
    title: "Spinny expands to new cities with premium services",
  },
];

